  false,\n\t\"url\": null,\n\t\"notes\": \"The Public Use Airports database is a geographic
  point database of aircraft landing facilities in the United States and U.S. Territories.
  This database has been subset out for Volusia County and some surrounding Airports
  in Lake County, Seminole County, Brevard County and Putnam County. Attribute data
  is provided on the physical and operational characteristics of the landing facility,
  current usage including enplanements and aircraft operations, congestion levels
  and usage categories. This geospatial data is derived from the FAA's National Airspace
  System Resource Aeronautical Data Product (Effective 20 January 2005).\",\n\t\"owner_org\":
